def superEggDrop(k: int, n: int) -> int:
    dp = [[0 for _ in range(n + 1)] for _ in range(k + 1)]
    for m in range(2, n + 1):
        for i in range(1, k + 1):
            (low, high) = (1, n)
            while low <= high:
                mid = (low + high) // 2
                (left, right) = (dp[i - 1][mid - 1], dp[i][n - mid])
                if left < right:
                    low = mid + 1
                    dp[i][m] = left + 1
                elif left > right:
                    high = mid - 1
                    dp[i][m] = right + 1
                else:
                    dp[i][m] = left + 1
                    low = mid + 1
            if dp[i][m] >= n:
                return m
    return n

